export default function SearchBar(props) {
    return (
        <div>
        <form className="searchBox">
            onSubmit={props.HandleSearch}
            <input
                type="search"
                placeholder="Search for an anime...."
                required
                value={props.search}
                onChange={e => props.setSearch(e.target.value)}/>
        </form>
        </div>

    )
}
